import React,{Component} from 'react'
import {Route} from 'react-router-dom';
import Hello from '../components/Users';
import Hi from '../components/Friends';
import {getData} from '../action/index'
import { connect } from 'react-redux';

class Content extends Component {
    render() {
    return (
          <div className='item2'>
          <center><label>Contents</label></center>
          <Route path="/" exact component={Hello}/> 
          <Route path="/Hi"  component={Hi}/>
        </div>
    
        );
    }
  }
  const mapDispatchToProps = (dispatch) =>{
    return{getData: () => dispatch (getData())}
  };
export default connect(mapDispatchToProps) (Content)
